func Test2Pack2BigID(t *testing.T) {
	var pack2TestTableBigID = testTable{ // big endian
		{[]byte{250, 203, 80, 0}, `s:                                                   \ns:   MDK-ARM_LL_UART_RTT0_PACK_STM32F030_NUCLEO-64   \ns:                                                   \n`},
		{[]byte{255, 198, 244, 1, 0, 4, 0, 0}, `MSG: triceFifoMaxDepth = 4, select = 0`},
		{[]byte{15, 241, 128, 2}, `--------------------------------------------------`},
	}
	doTableTest(t, NewPack2Decoder, bigEndian, pack2TestTableBigID, "unwrapped")
}

func TestPack2LBigID(t *testing.T) {
	var pack2LTestTableBigID = testTable{ // little endian
		{[]byte{0, 80, 203, 250}, `s:                                                   \ns:   MDK-ARM_LL_UART_RTT0_PACK_STM32F030_NUCLEO-64   \ns:                                                   \n`},
		{[]byte{1, 244, 198, 255, 0, 0, 4, 0}, `MSG: triceFifoMaxDepth = 4, select = 0`},
		{[]byte{2, 128, 241, 15}, `--------------------------------------------------`},
	}
	doTableTest(t, NewPack2Decoder, littleEndian, pack2LTestTableBigID, "unwrapped")
}

